  return (
    <React.Fragment>
      <Header />
      <div className="container mt-5">
        <div className="row">
          <main className="col-md-9">
            <Home />
          </main>
          <aside className="col-md-3">Sidebar</aside>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
